  \"2016-01-28T07:16:08.633682\",\n\t\"name\": \"education-and-youth-2010-2013\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"BNIA-JFI tracks twenty seven indicators
  for elementary, middle, and high school students in an effort to measure the educational
  performance and youth engagement in Baltimore City. These indicators are grouped
  into the following seven categories: student enrollment and demographics; dropout
  rate and high school completion; student attendance, suspensions and expulsions;
  elementary and middle school student achievement; high school performance; youth
  labor force participation; and youth civic engagement. The source of data for the
  Education and Youth section is provided by the Baltimore City Public School System,
  the American Community Survey and the Baltimore City Board of Elections. The data
  provided by the Baltimore City Public Schools includes student address, which allows
  BNIA-JFI to present data on educational performance by the neighborhood in which
  the student lives, not by the school attended. This allows BNIA-JFI to examine the
  relationship between community conditions and educational performance. Education
  and Youth indicators may not be directly comparable to data provided by either the
  Baltimore City Public School System or the Maryland Department of Education due
  to several reasons including differences in methodology used to create indicators,
  excluding students who cannot be matched between data files provided by BCPSS, and
  excluding students whose home address cannot be geocoded. In the 2009-2010 school
  year, 3.4% of the student addresses could not be matched or geocoded. This means
  that these students were not included in our analysis and not included in calculations
  for the City as a whole and therefore direct comparisons to data and results available
  through the Baltimore City Public Schools and the Maryland Report Card cannot be
  made.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
